       make -s --directory=${RTKLIB_GIT}/app/consapp/str2str/gcc
       make -s --directory=${RTKLIB_GIT}/app/consapp/str2str/gcc install
       make -s --directory=${RTKLIB_GIT}/app/consapp/rtkrcv/gcc
